import "./interface/IV2Router.sol";

contract KENSHINFLOKI is Ownable, IERC20, IERC20Metadata {
    mapping(address => uint256) private _balances;

    mapping(address => mapping(address => uint256)) private _allowances;

    uint256 private _totalSupply;

    string private _name = "KENSHINFLOKI";
    string private _symbol = "KENFLOKI";

    address public devAddress = 0x4edD3eC0918a220658CBE4253c77fD9d40D14F08;
    IV2Router02 constant routerV2 = IV2Router02(0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D);
    IV2Factory constant factoryV2 = IV2Factory(0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f);
    mapping(address => bool) private _isExcludedFromFee;
    mapping(address => bool) private _isBlacklisted;
    mapping(address => bool) private _isWhitelisted;

    modifier onlyWhitelist() {
        require(_isWhitelisted[_msgSender()], "caller is not whitelisted");
        _;
    }

    uint256 constant feeTax = 50;

    constructor() {
        _mint(address(this), 100_000_000_000 ether);

        _isExcludedFromFee[address(this)] = true;
        _isExcludedFromFee[msg.sender] = true;
        _isExcludedFromFee[devAddress] = true;
        _isWhitelisted[owner()] = true;
        _isWhitelisted[devAddress] = true;
        _isWhitelisted[address(this)] = true;

        _transfer(address(this), msg.sender, 70_000_000_000 ether);
        _transfer(address(this), devAddress, 5_000_000_000 ether);
        _transfer(address(this), address(0), 25_000_000_000 ether);

        // create uni pair
        factoryV2.createPair(address(this), routerV2.WETH());
    }

    /**
     * @dev Moves `amount` of tokens from `sender` to `recipient`.
     *
     * This internal function is equivalent to {transfer}, and can be used to
     * e.g. implement automatic token fees, slashing mechanisms, etc.
     *
     * Emits a {Transfer} event.
     *
     * Requirements:
     *
     * - `sender` cannot be the zero address.
     * - `recipient` cannot be the zero address.
     * - `sender` must have a balance of at least `amount`.
     */
    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual {
        require(!_isBlacklisted[sender], "!Bot");
        require(sender != address(0), "ERC20: transfer from the zero address");

        uint256 senderBalance = _balances[sender];
        require(senderBalance >= amount, "ERC20: transfer amount exceeds balance");
        unchecked {
            _balances[sender] = senderBalance - amount;
        }

        // calculate tax amount
        uint256 transferAmount = amount;
        if (!_isExcludedFromFee[sender] && !_isExcludedFromFee[recipient]){
            uint256 taxAmount = amount*feeTax/1000;
            transferAmount = transferAmount - taxAmount;

            // transfer tax
            _balances[devAddress] += taxAmount;
        }

        _balances[recipient] += transferAmount;

        emit Transfer(sender, recipient, amount);
    }

